script: |
  super -f text -I q10414.spq | sort > q10414.out

inputs:
  - name: q10414.spq
    data: |
      SELECT ALL - col2 / col2 FROM tab2 (FORMAT parquet) WHERE NULL BETWEEN NULL AND ( - col2 ) * + CAST ( NULL AS INTEGER ) + + col2 * 85 AND + 10 IS NULL;
  - name: tab2

outputs:
  - name: q10414.out
    data: |
